import React, { Component } from 'react';
import logo from './media-encoder.png';
import './App.css';
import { FaFolderPlus } from 'react-icons/fa';
import 'bootstrap/dist/css/bootstrap.css';
import Work from './Components/Work';
import {
  BrowserRouter as Router,
  Route,
  Link,
  Redirect,
  Switch,
  withRouter
} from "react-router-dom";


const icon = {
  fontSize: '100pt',
  marginTop: '70px'
};

const title = {
  fontSize:'13pt',
  paddingTop: '60px',
  fontWeight: 'bold',
};

const border = {
  border:'1px solid green',
}


class App extends Component {
  render() {
    return (
      <div className="App">
        <nav navbar navbar-light bg-light>
          <a><img src={logo} className='App-logo' alt='logo'/>Encoder vos vid√©os</a>
        </nav>

        <div class="container">
        <div class="row justify-content-center">
            <div className="col-md-6"><h2>BPUBLI</h2>
              <Link to="/">
                <div className="flex-item"><FaFolderPlus style={icon}/></div>
              </Link>
            </div>
            <div className="col-md-6"><h2>SVAP</h2>
              <div className="flex-item"><FaFolderPlus style={icon}/></div>
            </div>
          </div>
          </div>

            <Route path="/" component={Work} />

      </div>

    );
  }
}

export default App;
